import React, { Component } from 'react';
import {Button, Navbar, NavItem, Container, Row, Icon} from 'react-materialize'
import Divider from 'react-materialize/lib/Divider';


class LandingPage extends Component {
    render(){
        return(
            <div>
                <Navbar brand='logo' right>
                    <NavItem onClick={() => console.log('test click')}>PRICING</NavItem>
                    <NavItem href='components.html'>LOG IN</NavItem>
                    <NavItem href='components.html'>REGISTER</NavItem>
                </Navbar>
            </div>

        )
    }
};

export default LandingPage;
